import React from 'react';
import './Header.css';
import logo from '../assets/images/iskcon-logo.png';

const Header = () => {
  const phoneNumber = '+917618183108';
  const whatsappMessage = 'Hello, I would like to know more about ISKCON Deoghar temple.';

  const handleWhatsAppClick = () => {
    const encodedMessage = encodeURIComponent(whatsappMessage);
    window.open(`https://wa.me/${phoneNumber.replace('+', '')}?text=${encodedMessage}`, '_blank');
  };

  return (
    <header className="header">
      <div className="header-container">
        <div className="header-left">
          <img src={logo} alt="ISKCON Deoghar" className="logo" />
          <div className="logo-text">
            <h1>ISKCON Deoghar</h1>
            <p>International Society for Krishna Consciousness</p>
          </div>
        </div>

        <div className="header-right">
          <a href={`tel:${phoneNumber}`} className="contact-btn" title="Call Us">
            <i className="fas fa-phone"></i>
            <span>Contact Us</span>
          </a>
          <button onClick={handleWhatsAppClick} className="whatsapp-btn" title="Message on WhatsApp">
            <i className="fab fa-whatsapp"></i>
            <span>WhatsApp</span>
          </button>
        </div>
      </div>
    </header>
  );
};

export default Header;
